import React from "react";
import DishModalForm from "./dishModalForm";
import { Modal, Form } from "antd";

const DishModal = ({ visible, onhandleUpdate, onCancel, data }) => {
  const [form] = Form.useForm();
  return (
    <Modal
      visible={visible}
      okText="Edit"
      cancelText="Cancel"
      onCancel={onCancel}
      onOk={() => {
        form
          .validateFields()
          .then(values => {
            form.resetFields();
            onhandleUpdate(values);
          })
          .catch(info => {
            console.log("Validate Failed:", info);
          });
      }}
    >
      <DishModalForm
        form={form}
        data={data}
        firstData={"name"}
        secondData={"price"}
        thirdData={"type"}
        fourthData={"date"}
      />
    </Modal>
  );
};

export default DishModal;
